ingredients_array.push( [ 'CostanzoRecipes_Beverages_Sangria', 'Depending on the type of red wine you use, whether it is light bodied like a Beaujolais or deep and rich like a Cabernet, add the sparkling water to taste. Sangria is best enjoyed the day it is made, otherwise the oils from the citrus rind begin to impart flavor.Prep Time: 15 minutesTotal Time: 2 hoursYield: About 1½ quarts<ul><li onclick="handleItemClick()">1 (750-ml) bottle red wine</li><li onclick="handleItemClick()">¼ cup brandy</li><li onclick="handleItemClick()">¼ cup orange flavored liqueur (recommended: triple sec or Grand Marnier)</li><li onclick="handleItemClick()">2 tablespoons fresh lime juice</li><li onclick="handleItemClick()">2 tablespoons fresh orange juice</li><li onclick="handleItemClick()">¼ cup sugar</li><li onclick="handleItemClick()">½ orange, thinly sliced</li><li onclick="handleItemClick()">½ lemon, thinly sliced</li><li onclick="handleItemClick()">1 unwaxed apple, cored, and cut into thin wedges</li><li onclick="handleItemClick()">1 (750-ml) bottle sparkling water, or to taste, chilled</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_Sangria', '<ol><li onclick="handleItemClick()">Combine everything but the sparkling water in a large plastic container or glass pitchers.</li><li onclick="handleItemClick()">Cover and chill completely, 1 to 2 hours. When ready to serve, add 2 cups of the sparkling water, adding more to taste, if desired.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Beverages_Sangria', '<ul><li onclick="handleItemClick()"><a href="http://emerils.com/print/124088" target="_blank">http://emerils.com/print/124088</a></li><li onclick="handleItemClick()">Made for Jan\'s Ice Cream Social [2017-06-13 Tue] <ul><li onclick="handleItemClick()">swapped strawberries for apples and cranberry juice or orange</li></ul></li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Beverages_OatMilk', '<ul><li onclick="handleItemClick()">6 cups water</li><li onclick="handleItemClick()">1 cup whole rolled oats</li><li onclick="handleItemClick()">4 teaspoons maple syrup</li><li onclick="handleItemClick()">1 teaspoon vanilla extract</li><li onclick="handleItemClick()">½ teaspoon sea salt</li><li onclick="handleItemClick()">½ cup flaked coconut (<i class="conditional-space-after">optional</i>)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_OatMilk', '<ol><li onclick="handleItemClick()">Combine the oats, water, maple syrup, vanilla, and salt in a high-powered blender and blend for 20 seconds.</li><li onclick="handleItemClick()">Place a fine mesh strainer over a large bowl and strain the milk without pushing any excess pulp through the strainer. This will create a creamier texture that’s not gritty or gummy.</li><li onclick="handleItemClick()">Add more maple syrup, to taste, if desired. Chill overnight.<span class="note">   If you want to drink your oat milk right away, I recommend adding ice - it\'s flavor is best when well chilled.</span></li></ol><span class="note">As the oat milk sits in the fridge, natural separation will occur. You can shake it, if you like, but I like it\'s texture best when I leave pulp at the bottom and pour off the top.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Beverages_OatMilk', '<ul><li onclick="handleItemClick()">From <a href="https://www.loveandlemons.com/oat-milk/#wprm-recipe-container-42113" target="_blank">https://www.loveandlemons.com/oat-milk/#wprm-recipe-container-42113</a></li><li onclick="handleItemClick()">date created: [2023-02-10 Fri] </li><li onclick="handleItemClick()">[2023-03-01 Wed] I like to shake the milk each time before I use it because otherwise it is quite thin. But shaking it can make it a tiny bit slimy.</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_Mojitos', '<ul><li onclick="handleItemClick()">1 large sprig spearmint</li><li onclick="handleItemClick()">.75 oz simple syrup (1:1 sugar to water; <i class="conditional-space-after">boiled for 3 minutes</i>)</li></ul><ul><li onclick="handleItemClick()">Half a spent lime hull, and</li><li onclick="handleItemClick()">1 oz of lime juice (no less, no more)</li><li onclick="handleItemClick()">2 oz white rum</li><li onclick="handleItemClick()">3 oz sparkling mineral water </li><li onclick="handleItemClick()">Top with crushed ice and mix with a straw until drink is combined and glass is frosty.</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_Mojitos', '<ol><li onclick="handleItemClick()">4 large sprig spearmint</li><li onclick="handleItemClick()">3 oz simple syrup (1:1 sugar to water; <i class="conditional-space-after">boiled for 3 minutes</i>)</li></ol><ol><li onclick="handleItemClick()">Four halves of spent lime hull, and</li><li onclick="handleItemClick()">4 oz of lime juice (no less, no more)</li><li onclick="handleItemClick()">8 oz white rum</li><li onclick="handleItemClick()">12 oz sparkling mineral water </li><li onclick="handleItemClick()">Top with crushed ice and mix with a straw until drink is combined and glass is frosty.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Beverages_Mojitos', '<ul><li onclick="handleItemClick()"><a href="http://www.jeffreymorgenthaler.com/2007/mojito/" target="_blank">http://www.jeffreymorgenthaler.com/2007/mojito/</a></li><li onclick="handleItemClick()">Made at our 50/50 party, July 2011. A big hit!</li><li onclick="handleItemClick()">date created: [2011-07-21 Thu] </li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_HotCocoa', '<ul><li onclick="handleItemClick()">Boil 8 oz boiling water</li><li onclick="handleItemClick()">4 TBS (¼ cup, 30g) powdered Whole milk </li><li onclick="handleItemClick()">2 or up to 3 TBS (30-45g) cane sugar (or brown) *</li><li onclick="handleItemClick()">Add 3 TBS (27g) full fat cocoa</li><li onclick="handleItemClick()">Stir like mad! If it ain’t mixed now, too late.</li><li onclick="handleItemClick()">Now, the balance is up to you, I add 4 oz. ½ and ½</li><li onclick="handleItemClick()">...or you can add 4 oz. milk.</li><li onclick="handleItemClick()">Heat the whole mixture and serve.</li></ul>​* This recipe is awfully sweet. Consider using less sugar: perhaps 20-25g.' ] );
credits_array.push( [ 'CostanzoRecipes_Beverages_HotCocoa', '<ul><li onclick="handleItemClick()">date created: [2019-12-29 Sun] </li><li onclick="handleItemClick()">From Todd McCagg</li><li onclick="handleItemClick()">[2020-03-18 Wed] I use brown sugar, but keep it toward the lower end. I use half half-and-half and half almond milk. Miss T seems to like it!</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Beverages_ChaiTea', '<ul><li onclick="handleItemClick()">1 Tblsp fennel or anise seed</li><li onclick="handleItemClick()">6 green cardamom pods</li><li onclick="handleItemClick()">12 cloves</li><li onclick="handleItemClick()">1 cinnamon stick</li><li onclick="handleItemClick()">Unknown type: ’entity’inch ginger root, sliced thinly</li><li onclick="handleItemClick()">Unknown type: ’entity’teasp black pepper corns</li><li onclick="handleItemClick()">2 bay leaves</li><li onclick="handleItemClick()">7 cups water</li><li onclick="handleItemClick()">2 Tblsp Darjeeling tea</li><li onclick="handleItemClick()">3 Tblsp honey or brown sugar (was 6)</li><li onclick="handleItemClick()">1 cup milk</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Beverages_ChaiTea', 'Plain text here!!!<ol><li onclick="handleItemClick()">Boil fennel, cardamom, cloves, cinnamon, ginger root, pepper corns, bay leaves and water for 5 minutes, then steep for 10 minutes.</li><li onclick="handleItemClick()">Add tea, honey and milk. Bring to a boil and simmer 5 minutes. Strain.</li></ol>' ] );
yields_array.push( [ 'CostanzoRecipes_Beverages_ChaiTea', '<ul><li onclick="handleItemClick()">Serves 8.</li></ul>' ] );
