ingredients_array.push( [ 'CostanzoRecipes_Appetizers_HotPepperJelly', '<ul><li onclick="handleItemClick()">2½ cups finely chopped red bell peppers</li><li onclick="handleItemClick()">1¼ cups finely chopped green bell peppers</li><li onclick="handleItemClick()">¼ cup finely chopped jalapeno peppers</li><li onclick="handleItemClick()">1 cup apple cider vinegar</li><li onclick="handleItemClick()">1 (1.75 ounce) package powdered pectin</li><li onclick="handleItemClick()">5 cups white sugar</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Appetizers_HotPepperJelly', '<ol><li onclick="handleItemClick()">Sterilize six 8-ounce canning jars and lids according to the manufacturer\'s instructions.</li><li onclick="handleItemClick()">Heat water in a hot water canner.</li><li onclick="handleItemClick()">Place bell peppers and jalapeño peppers in a large saucepan over high heat; stir in vinegar and fruit pectin.</li><li onclick="handleItemClick()">Bring to a rolling boil, stirring constantly.</li><li onclick="handleItemClick()">Stir in sugar; bring back to a rolling boil, stirring constantly.</li><li onclick="handleItemClick()">Allow to boil for 1 minute, then remove from the heat and skim any foam off the top.</li><li onclick="handleItemClick()">Quickly ladle jelly into sterile jars, filling to within ¼-inch of the tops.</li><li onclick="handleItemClick()">Cover with flat lids and screw on rings tightly.</li><li onclick="handleItemClick()">Place jars in the rack and slowly lower jars into the canner.</li><li onclick="handleItemClick()">The water should cover the jars completely and should be hot but not boiling.</li><li onclick="handleItemClick()">Bring water to a boil; cover the canner and process for 5 minutes.</li></ol><span class="note">This makes 6 (six) 8-ounce jars.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Appetizers_HotPepperJelly', '<ul><li onclick="handleItemClick()">[2022-09-28 Wed] Made, filled jars and refrigerated them. This was tasty, but not terrible spicy.</li><li onclick="handleItemClick()">date created: [2022-10-12 Wed] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Appetizers_Gougeres', '<ul><li onclick="handleItemClick()">½ cup whole milk</li><li onclick="handleItemClick()">½ cup water</li><li onclick="handleItemClick()">8 tablespoons (1 stick) unsalted butter, cut into 4 pieces</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">1 cup all-purpose flour</li><li onclick="handleItemClick()">5 large eggs, at room temperature</li><li onclick="handleItemClick()">1 ½ cups coarsely grated cheese, such as Gruyère or cheddar (about 6 ounces; see above)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Appetizers_Gougeres', '<ol><li onclick="handleItemClick()">Position the racks to divide the oven into thirds and preheat the oven to 425 degrees F.</li><li onclick="handleItemClick()">Line two baking sheets with silicone baking mats or parchment paper.</li><li onclick="handleItemClick()">Bring the milk, water, butter, and salt to a rapid boil in a heavy-bottomed medium saucepan over high heat.</li><li onclick="handleItemClick()">Add the flour all at once, lower the heat to medium-low, and immediately start stirring energetically with a wooden spoon or heavy whisk.</li><li onclick="handleItemClick()">The dough will come together and a light crust will form on the bottom of the pan.</li><li onclick="handleItemClick()">Keep stirring—with vigor—for another minute or two to dry the dough.</li><li onclick="handleItemClick()">The dough should now be very smooth.</li><li onclick="handleItemClick()">Turn the dough into the bowl of a mixer fitted with the paddle attachment or into a bowl that you can use for mixing with a hand mixer or a wooden spoon and elbow grease.</li><li onclick="handleItemClick()">Let the dough sit for a minute, then add the eggs one by one and beat, beat, beat until the dough is thick and shiny.</li><li onclick="handleItemClick()">Make sure that each egg is completely incorporated before you add the next, and don\'t be concerned if the dough separates—by the time the last egg goes in, the dough will come together again.</li><li onclick="handleItemClick()">Beat in the grated cheese.</li><li onclick="handleItemClick()">Once the dough is made, it should be spooned out immediately.</li><li onclick="handleItemClick()">Using about 1 tablespoon of dough for each gougère , drop the dough from a spoon onto the lined baking sheets, leaving about 2 inches of puff space between the mounds.</li><li onclick="handleItemClick()">Using about 1 tablespoon of dough for each gougère, drop the dough from a spoon onto the lined baking sheets, leaving about 2 inches of puff space between the mounds.</li><li onclick="handleItemClick()">Slide the baking sheets into the oven and immediately turn the oven temperature down to 375 degrees F.</li><li onclick="handleItemClick()">Bake for 12 minutes, then rotate the pans from front to back and top to bottom.</li><li onclick="handleItemClick()">Continue baking until the gougères are golden, firm, and, yes, puffed, another 12 to 15 minutes or so.</li><li onclick="handleItemClick()">Serve warm, or transfer the pans to racks to cool.</li></ol><span class="note">Gougères are good straight from the oven and at room temperature. I like them both ways, but I think you can appreciate them best when they\'re still warm. Serve with kir, white wine, or Champagne.</span><span class="note">The best way to store gougères is to shape the dough, freeze the mounds on a baking sheet, and then, when they\'re solid, lift them off the sheet and pack them airtight in plastic bags. Bake them straight from the freezer—no need to defrost—just give them a minute or two more in the oven. Leftover puffs can be kept at room temperature over night and reheated in a 350-degree-F oven, or they can be frozen and reheated before serving.</span>' ] );
credits_array.push( [ 'CostanzoRecipes_Appetizers_Gougeres', '<ul><li onclick="handleItemClick()"><a href="https://www.epicurious.com/recipes/food/views/gougeres-361149" target="_blank">https://www.epicurious.com/recipes/food/views/gougeres-361149</a></li><li onclick="handleItemClick()">date created: [2022-12-03 Sat] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Appetizers_EasyRedPepperHummus', 'Serves 8<ul><li onclick="handleItemClick()">1 (16 ounce) can garbanzo beans, drained and rinsed</li><li onclick="handleItemClick()">1 tablespoon olive oil</li><li onclick="handleItemClick()">1 medium red bell pepper, cut into ½ inch pieces</li><li onclick="handleItemClick()">1 tablespoon tahini</li><li onclick="handleItemClick()">1 fresh lime, juiced</li><li onclick="handleItemClick()">1½ tablespoons water</li><li onclick="handleItemClick()">½ teaspoon salt</li><li onclick="handleItemClick()">¼ teaspoon ground black pepper</li><li onclick="handleItemClick()">¼ teaspoon garlic powder</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Appetizers_EasyRedPepperHummus', '<ol><li onclick="handleItemClick()">In a food processor or blender, mix the garbanzo beans, olive oil, red bell pepper, tahini, lime juice, water, salt, black pepper, and garlic powder. Blend until smooth. </li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Appetizers_EasyRedPepperHummus', '<ul><li onclick="handleItemClick()">Posted by: "New Hope-L\'ville Vegetarians"  nhlveg@yahoo.com     nhlveg</li><li onclick="handleItemClick()">Sat Dec 13, 2008 7:16 am (PST)</li><li onclick="handleItemClick()">Here\'s yet another "Recipe of the Week".  Please don\'t forget to send in your favorite recipes so we can keep this going.</li><li onclick="handleItemClick()">date created: [2008-12-15 Mon] </li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Appetizers_CauliflowerPopcorn', '<ul><li onclick="handleItemClick()">2 pounds cauliflower, cut into ½- to 1-inch pieces and florets</li><li onclick="handleItemClick()">⅓ cup plus 1 tablespoon extra-virgin olive oil (or melted ghee)</li><li onclick="handleItemClick()">¼ cup nutritional yeast, divided</li><li onclick="handleItemClick()">¼ teaspoon red-pepper flakes or pinch of ground cayenne</li><li onclick="handleItemClick()">Kosher salt and black pepper</li><li onclick="handleItemClick()">½ cup panko bread crumbs</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Appetizers_CauliflowerPopcorn', '<ol><li onclick="handleItemClick()">Heat the oven to 450°.</li><li onclick="handleItemClick()">On a sheet pan, toss the cauliflower with ⅓ cup olive oil, 1 tablespoon nutritional yeast and the red-pepper flakes.</li><li onclick="handleItemClick()">Season generously with salt and pepper, then toss well to evenly distribute.</li><li onclick="handleItemClick()">Spread in an even layer and roast for 20 minutes, until the cauliflower is crisp-tender and starting to brown at the edges.</li><li onclick="handleItemClick()">Meanwhile, in a small bowl, stir together the panko, remaining 3 tablespoons nutritional yeast and remaining tablespoon olive oil.</li><li onclick="handleItemClick()">Season with salt and pepper, and stir with a fork until evenly combined.</li><li onclick="handleItemClick()">When the 20 minutes are up, stir the cauliflower, spread it into an even layer and sprinkle with the panko mixture.</li><li onclick="handleItemClick()">Roast until the panko is toasted, 10 to 12 minutes.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Appetizers_CauliflowerPopcorn', '<ul><li onclick="handleItemClick()">From <a href="https://cooking.nytimes.com/recipes/1022966-cauliflower-popcorn" target="_blank">https://cooking.nytimes.com/recipes/1022966-cauliflower-popcorn</a></li><li onclick="handleItemClick()">date created: [2023-02-20 Mon] </li><li onclick="handleItemClick()">Serves 4.</li><li onclick="handleItemClick()">[2023-02-18 Sat] Made for T, Greg and MaryAnn. They said they liked it a lot.</li></ul>' ] );
ingredients_array.push( [ 'CostanzoRecipes_Appetizers_CaramelizedOnionandSunDriedTomatoDip', 'Makes 1 cup; serves 4-6<ul><li onclick="handleItemClick()">2 tablespoons	olive oil</li><li onclick="handleItemClick()">1 tablespoon	butter</li><li onclick="handleItemClick()">4 cups		sliced mild onions</li><li onclick="handleItemClick()">¼ teaspoon	dried rosemary, crumbled</li><li onclick="handleItemClick()">⅛ teaspoon	dried thyme</li><li onclick="handleItemClick()">⅓ cup		water</li><li onclick="handleItemClick()">2 tablespoons	white wine</li><li onclick="handleItemClick()">6			oil-marinated sun-dried tomato halves</li><li onclick="handleItemClick()">1 tablespoon	chopped fresh parsley</li><li onclick="handleItemClick()">½ teaspoon	capers (optional!)</li><li onclick="handleItemClick()">6 small		pitted black olives (For best results use a good flavorful olive such as a kalamata.)</li></ul>' ] );
methods_array.push( [ 'CostanzoRecipes_Appetizers_CaramelizedOnionandSunDriedTomatoDip', '<ol><li onclick="handleItemClick()">In a large skillet over medium-high heat, heat the oil and the butter.</li><li onclick="handleItemClick()">Add the onion; cook, stirring until softened about 2 minutes.</li><li onclick="handleItemClick()">Stir in the the rosemary and thyme.</li><li onclick="handleItemClick()">Lower the heat and cook slowly, uncovered, until onions are golden, stirring occasionally, about 45 minutes. [Don\'t try to hurry the onions; they\'ll know this and won\'t caramelize! -jc]</li><li onclick="handleItemClick()">Add the water, wine, sun-dried tomatoes, parsley and capers (if you have to!). Bring to a boil.</li><li onclick="handleItemClick()">Remove from heat and transfer to a food processor container fitted with a steel blade.</li><li onclick="handleItemClick()">Add the olives. Cover and process until everything is finely chopped.</li><li onclick="handleItemClick()">Variation: Substitute water for the wine.</li></ol>' ] );
credits_array.push( [ 'CostanzoRecipes_Appetizers_CaramelizedOnionandSunDriedTomatoDip', '<ul><li onclick="handleItemClick()">date created: [2007-06-27 Wed] </li><li onclick="handleItemClick()">From a recipe appearing on page 65 of the book "1,000 Vegetarian Recipes" by Carol Gelles.</li><li onclick="handleItemClick()">[2002-11-01 Fri] Served by John and Tracey at their house in November, 2002.</li><li onclick="handleItemClick()">[2021-07-16 Fri] Made for Aron Cook\'s 75<sup>th</sup>birthday.</li></ul>' ] );
